import React from "react";
import Infos from "./example_data.json";

const Test = () => {
  const info = Infos.map((item) => (
    <div key={item.id}>
      <p>{item.name}</p>
      <p>{item.categories}</p>
      <img src={item.profile_image_url} width="100" />
      <p>
        {item.images.forEach((imgs) => {
          return <img src={imgs} width="50" />;
        })}
      </p>
      ==================================
    </div>
  ));

  const y = "2";
  return <div>{info}</div>;
};

export default Test;
